import React from "react";
import { Link } from "react-router-dom";
import logo from '../../images/logo.svg';
import "../RegisterAndLoginForm/RegisterAndLoginForm.css";

function RegisterAndLoginForm(props) {
  return (
    <section id={props.name}>
      <form className="form" id={props.id} onSubmit={props.onSubmit}>
        <Link to="/">
            <img className='button header__logo' type='button' src={logo} alt='Лоотип'/>
        </Link>
        <p className='register__header'>{props.title}</p>
        {props.children}
        {props.Link}
      </form>
    </section>
  );
}

export default RegisterAndLoginForm;

